import React from 'react'
import { withRouter } from 'react-router-dom'
import HeaderBar from "./HeaderBar";
import "../stylesheets/genericRouter.scss"
import Footer from "./Footer";
import {static_links} from "../db/const";

class GenericRouter extends React.Component {
    getNameFromRoute() {
        const currentRoute = this.props.location.pathname.slice(1)
        return static_links.filter(link => link.key)
    }

    render() {
        return (
            <div className="generic-router">
                <HeaderBar/>
                <p>Geenric</p>
                <p>Geenric</p>
                <p>Geenric</p>
                <p>{JSON.stringify(this.props.location)}</p>
                <Footer/>
            </div>
        )
    }
}

export default withRouter(GenericRouter)
